def print_row(row):
    print("[", end = "")
    for elem in row:
        print((str(elem)[:5]).rjust(6), end=" ")
    print("]", end = "\n")

def display(A):
    n = len(A)
    for i in range (0, n):
        print_row(A[i]) 
    print()

def IdentityMatrix(n, diag=1):
    L = [0] * n
    for i in range(n):
        L[i] = [0] * n
    for i in range(n): L[i][i] = diag
    return L

def sum(m1, m2):
    # returns the sum of two matrices
    n = len(m1)
    m3 = IdentityMatrix(n, diag=0)
    for i in range(n):
        for j in range(n):
            m3[i][j] = m1[i][j] + m2[i][j]
    return m3

def norm2(row, st, en):
    # returns the 2-norm of that sub-row of input row, 
    # which starts at 'st' and ends at 'en - 1'
    sum = 0
    i = st
    while(i < en):
        sum += (row[i] * row[i])
        i += 1
    return mathslib.sqrt(sum) 

