def to_binary(A):
    # converts a given n x n matrix to binary
    n = len(A)
    to_show = IdentityMatrix(n, diag=0)
    for i in range(n):
        for j in range(n):
            if A[i][j] != 0:
                to_show[i][j] = 1
    return to_show

def num_non_zero(A):
    # returns the num. of non-zeros in the square matrix A
    nnz = 0
    n = len(A)
    for i in range(n):
        for j in range(n):
            if A[i][j] != 0:
                nnz += 1

    return nnz

def matrix_plotter(A):
    # prints the non-zero entires of A on an n X n grid
    to_show = to_binary(A)
    nnz = num_non_zero(to_show)
    print("This has", nnz, "nonzero entries.")
    plt.imshow(to_show, cmap='Blues', interpolation='none')
    plt.show()
    
